import axios from 'axios';
import {useEffect, useState} from 'react';
import TextField from '@material-ui/core/TextField';
import Button from '@material-ui/core/Button';
import ReactAvatarEdit from 'react-avatar-edit';
import { makeStyles } from '@material-ui/core/styles';
import ReactAvatar from '@material-ui/core/Avatar';
import Select from '@material-ui/core/Select';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';
import Autocomplete from '@material-ui/lab/Autocomplete';

const useStyles = makeStyles((theme) => ({
    large: {
        width: theme.spacing(14),
        height: theme.spacing(14),
    },
    formControl: {
        marginLeft: "1em",
        minWidth: 120,
    },
    formControl2: {
        marginTop: "1em",
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));

export default function ApplyTutor(props) {
    const {setDisplayNavbar, setUser} = props;
    const [localUser, setLocalUser] = useState();
    const classes = useStyles();
    
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();
        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    setUser(user);
                    setLocalUser(user);
                } else {
                    window.open('/', '_self');
                }
            })
        return () => {
            ac.abort();
        }
    }, [setUser]);

    const [avatarData, setAvatarData] = useState({
        preview: null,
        src: null,
        file: null,
        currentExtension: null,
        originalFile: null
    });

    const [uploadingNewFile, setUploadingNewFile] = useState(false);

    function onClose() {
        setUploadingNewFile(false);
        setAvatarData({preview: null, src: null, file: null, originalFile: null});
    }
    
    async function onCrop(preview) {
        setAvatarData(prevData => {
            return {...prevData, preview};
        })
        const currentExtension = avatarData.currentExtension;
        const file = await urltoFile(preview, 'userImage.' + currentExtension, 'image/' + currentExtension)
        setAvatarData(prevData => {
            return {...prevData, file: file};
        })
    }
    
    function onBeforeFileLoad(event) {
        const re = /\.(gif|jpe?g|tiff?|png|webp|bmp)$/i;
        const file = event.target.files[0];
        if (file.size > 1000000000000000) {
            event.target.value = "";
            alert("File size is too big.")
        } else if (!re.test(file.name)) {
            alert("File extension is not allowed.")
        } else {
            setUploadingNewFile(true);
            const separator = /(?:\.([^.]+))?$/;
            setAvatarData(prevData => {
                return {...prevData, currentExtension: separator.exec(file.name)[1], originalFile: file};
            })
        }
    }
    
    function urltoFile(url, filename, mimeType){
        return (fetch(url)
            .then(function(res){return res.arrayBuffer();})
            .then(function(buf){return new File([buf], filename,{type:mimeType});})
        );
    }

    const [gender, setGender] = useState(1);
    const [country, setCountry] = useState("Indonesia");

    const availableSubjects = [
        "Mathematics",
        "Physics",
        "Computer science",
        "Biology",
        "Chemistry",
        ""
    ]

    const top100Films = [
        { title: 'The Shawshank Redemption', year: 1994 },
        { title: 'The Godfather', year: 1972 },
        { title: 'The Godfather: Part II', year: 1974 },
        { title: 'The Dark Knight', year: 2008 },
        { title: '12 Angry Men', year: 1957 },
        { title: "Schindler's List", year: 1993 },
        { title: 'Pulp Fiction', year: 1994 },
        { title: 'The Lord of the Rings: The Return of the King', year: 2003 },
        { title: 'The Good, the Bad and the Ugly', year: 1966 },
        { title: 'Fight Club', year: 1999 },
        { title: 'The Lord of the Rings: The Fellowship of the Ring', year: 2001 },
        { title: 'Star Wars: Episode V - The Empire Strikes Back', year: 1980 },
        { title: 'Forrest Gump', year: 1994 },
        { title: 'Inception', year: 2010 },
        { title: 'The Lord of the Rings: The Two Towers', year: 2002 },
        { title: "One Flew Over the Cuckoo's Nest", year: 1975 },
        { title: 'Goodfellas', year: 1990 },
        { title: 'The Matrix', year: 1999 },
        { title: 'Seven Samurai', year: 1954 },
        { title: 'Star Wars: Episode IV - A New Hope', year: 1977 },
        { title: 'City of God', year: 2002 },
        { title: 'Se7en', year: 1995 },
        { title: 'The Silence of the Lambs', year: 1991 },
        { title: "It's a Wonderful Life", year: 1946 },
        { title: 'Life Is Beautiful', year: 1997 },
        { title: 'The Usual Suspects', year: 1995 },
        { title: 'Léon: The Professional', year: 1994 },
        { title: 'Spirited Away', year: 2001 },
        { title: 'Saving Private Ryan', year: 1998 },
        { title: 'Once Upon a Time in the West', year: 1968 },
        { title: 'American History X', year: 1998 },
        { title: 'Interstellar', year: 2014 },
        { title: 'Casablanca', year: 1942 },
        { title: 'City Lights', year: 1931 },
        { title: 'Psycho', year: 1960 },
        { title: 'The Green Mile', year: 1999 },
        { title: 'The Intouchables', year: 2011 },
        { title: 'Modern Times', year: 1936 },
        { title: 'Raiders of the Lost Ark', year: 1981 },
        { title: 'Rear Window', year: 1954 },
        { title: 'The Pianist', year: 2002 },
        { title: 'The Departed', year: 2006 },
        { title: 'Terminator 2: Judgment Day', year: 1991 },
        { title: 'Back to the Future', year: 1985 },
        { title: 'Whiplash', year: 2014 },
        { title: 'Gladiator', year: 2000 },
        { title: 'Memento', year: 2000 },
        { title: 'The Prestige', year: 2006 },
        { title: 'The Lion King', year: 1994 },
        { title: 'Apocalypse Now', year: 1979 },
        { title: 'Alien', year: 1979 },
        { title: 'Sunset Boulevard', year: 1950 },
        { title: 'Dr. Strangelove or: How I Learned to Stop Worrying and Love the Bomb', year: 1964 },
        { title: 'The Great Dictator', year: 1940 },
        { title: 'Cinema Paradiso', year: 1988 },
        { title: 'The Lives of Others', year: 2006 },
        { title: 'Grave of the Fireflies', year: 1988 },
        { title: 'Paths of Glory', year: 1957 },
        { title: 'Django Unchained', year: 2012 },
        { title: 'The Shining', year: 1980 },
        { title: 'WALL·E', year: 2008 },
        { title: 'American Beauty', year: 1999 },
        { title: 'The Dark Knight Rises', year: 2012 },
        { title: 'Princess Mononoke', year: 1997 },
        { title: 'Aliens', year: 1986 },
        { title: 'Oldboy', year: 2003 },
        { title: 'Once Upon a Time in America', year: 1984 },
        { title: 'Witness for the Prosecution', year: 1957 },
        { title: 'Das Boot', year: 1981 },
        { title: 'Citizen Kane', year: 1941 },
        { title: 'North by Northwest', year: 1959 },
        { title: 'Vertigo', year: 1958 },
        { title: 'Star Wars: Episode VI - Return of the Jedi', year: 1983 },
        { title: 'Reservoir Dogs', year: 1992 },
        { title: 'Braveheart', year: 1995 },
        { title: 'M', year: 1931 },
        { title: 'Requiem for a Dream', year: 2000 },
        { title: 'Amélie', year: 2001 },
        { title: 'A Clockwork Orange', year: 1971 },
        { title: 'Like Stars on Earth', year: 2007 },
        { title: 'Taxi Driver', year: 1976 },
        { title: 'Lawrence of Arabia', year: 1962 },
        { title: 'Double Indemnity', year: 1944 },
        { title: 'Eternal Sunshine of the Spotless Mind', year: 2004 },
        { title: 'Amadeus', year: 1984 },
        { title: 'To Kill a Mockingbird', year: 1962 },
        { title: 'Toy Story 3', year: 2010 },
        { title: 'Logan', year: 2017 },
        { title: 'Full Metal Jacket', year: 1987 },
        { title: 'Dangal', year: 2016 },
        { title: 'The Sting', year: 1973 },
        { title: '2001: A Space Odyssey', year: 1968 },
        { title: "Singin' in the Rain", year: 1952 },
        { title: 'Toy Story', year: 1995 },
        { title: 'Bicycle Thieves', year: 1948 },
        { title: 'The Kid', year: 1921 },
        { title: 'Inglourious Basterds', year: 2009 },
        { title: 'Snatch', year: 2000 },
        { title: '3 Idiots', year: 2009 },
        { title: 'Monty Python and the Holy Grail', year: 1975 },
    ];

    return <div className="wrapper">
        <div className="sidebar">
            <h2>Apply</h2>
            <ul>
                <li><a href="#personalInformation">Personal information</a></li>
                <li><a href="#subjects">Subjects</a></li>
                <li><a href="#education">Education</a></li>
                <li><a href="#experience">Experience</a></li>
                <li><a href="#policyAgreement">Policy Agreement</a></li>
                <li><a href="#submitApplication">Submit Application</a></li>
            </ul>
        </div>
        <div className="content">
            <div className="box">
                <a name="personalInformation"></a>
                <div className="box_top">
                    <h2>Personal information</h2>
                </div>
                <div className="box_bottom">
                    <form>
                        <TextField id="outlined-basic" label="Phone number" variant="outlined" />
                        <TextField style={{marginLeft: "1em"}} id="outlined-basic" label="Headline" variant="outlined" />
                        <FormControl variant="outlined" className={classes.formControl}>
                            <InputLabel id="demo-simple-select-outlined-label">Gender</InputLabel>
                            <Select
                                labelId="demo-simple-select-outlined-label"
                                id="demo-simple-select-outlined"
                                value={gender}
                                onChange={(event) => {
                                    setGender(event.target.value);
                                }}
                                label="Gender"
                            >
                                <MenuItem value={1}>Male</MenuItem>
                                <MenuItem value={0}>Female</MenuItem>
                                <MenuItem value={-1}>Prefer not to say</MenuItem>
                            </Select>
                        </FormControl>
                        <FormControl variant="outlined" className={classes.formControl}>
                            <InputLabel id="demo-simple-select-outlined-label">Country</InputLabel>
                            <Select
                                labelId="demo-simple-select-outlined-label"
                                id="demo-simple-select-outlined"
                                value={country}
                                onChange={(event) => {
                                    setCountry(event.target.value);
                                }}
                                label="Country"
                            >   
                                <MenuItem value={"Australia"}>Australia</MenuItem>
                                <MenuItem value={"Canada"}>Canada</MenuItem>
                                <MenuItem value={"Indonesia"}>Indonesia</MenuItem>
                                <MenuItem value={"Ireland"}>Ireland</MenuItem>
                                <MenuItem value={"Malaysia"}>Malaysia</MenuItem>
                                <MenuItem value={"Singapore"}>Singapore</MenuItem>
                                <MenuItem value={"United Kingdom"}>United Kingdom</MenuItem>
                                <MenuItem value={"United States of America"}>United States of America</MenuItem>
                                <MenuItem value={"Others"}>Others</MenuItem>
                            </Select>
                        </FormControl>
                        <br />
                        <TextField
                            placeholder="Description about yourself"
                            multiline
                            rows={4}
                            rowsMax={4}
                            variant="outlined"
                            style={{marginTop: "1em", width: "61.6%"}}
                        />
                    </form>
                </div>
            </div>
            <div className="box">
                <a name="subjects"></a>
                <div className="box_top">
                    <h2>Subjects</h2>
                </div>
                <div className="box_bottom">
                <Autocomplete
                    multiple
                    limitTags={2}
                    id="multiple-limit-tags"
                    options={top100Films}
                    getOptionLabel={(option) => option.title}
                    defaultValue={[top100Films[13], top100Films[12], top100Films[11]]}
                    renderInput={(params) => (
                        <TextField {...params} variant="outlined" label="limitTags" placeholder="Favorites" />
                    )}
                />
                </div>
            </div>
            <div className="box">
                <a name="education"></a>
                <div className="box_top">
                    <h2>Education</h2>
                </div>
                <div className="box_bottom">

                </div>
            </div>
            <div className="box">
                <a name="experience"></a>
                <div className="box_top">
                    <h2>Experience</h2>
                </div>
                <div className="box_bottom">

                </div>
            </div>
            <div className="box">
                <a name="policyAgreement"></a>
                <div className="box_top">
                    <h2>Policy Agreement</h2>
                </div>
                <div className="box_bottom">

                </div>
            </div>
            <div className="box">
                <a name="submitApplication"></a>
                <div className="box_top">
                    <h2>Submit Application</h2>
                </div>
                <div className="box_bottom">

                </div>
            </div>
        </div>
        
    </div>
}
